    false,nt"url": null,nt"notes": "This study discusses past and current ORV/ATV
    use on Panther Swamp National Wildlife Refuge and provides management objectives.
    Refuge staff concluded that the use of ATV's is needed to accomplish the refuge's
    recreational  objectives; specifically, hunting and access to the interior of the
    refuge. The purpose of this study is to review past and current off-road vehicle
    and all-terrain vehicle (ORV/ATV) use and make recommendations for future use on
    Panther Swamp National Wildlife Refuge.",nt"license_title": "License Not Specified",nt"extras":
